import React from 'react';
import "./AddNewBook.scss"

const AddNewBook = () => {
    return <div>
        <h1 className="addNewBookTitle">Add a new book</h1>
        <form action="http://localhost:5000/" method="post" >
            <input type="text" placeholder="enter book title" />
            <input type="text" placeholder="enter desc" />
            <input type="number" placeholder="book's price" />
            <input type="number" placeholder="books in stock" />
            <input type="text" placeholder="book' category" />
            <input type="text" placeholder="book' img url" />
            <button type="submit">SUBMIT</button>
        </form>
    </div>;
};

export default AddNewBook;
